import React from 'react';
import './Menu.css';
import Tab from "./Tab";

function Menu({ menuEntry, onSelect }) {
    return (
        <div className="menu">
            {menuEntry.map((entry, index) => (
                <button onClick={() => onSelect(entry.key)}>Characters</button>
            ))}

        </div>
    );
}

export default Menu;
